import React from "react";
import CountUp from "react-countup/build/CountUp";


function Count(){
    return(
        <CountUp start={0} end={100} delay={0}>
  {({ countUpRef }) => (
    <div>
      <span ref={countUpRef} />
    </div>
  )}
</CountUp>
    )
}

export default Count;
